import React, {useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Box from "@material-ui/core/Box";
import greenBackground from '../images/vitalii-pavlyshynets-kcRFW-Hje8Y-unsplash.jpg'

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        background: 'linear-gradient(24deg, rgba(0,91,20,0) 0%, rgba(197,255,126,0) 100%);'
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: 'black',
        vh: '100%'
    },
    box: {
      backgroundImage: `url(${greenBackground})`,
        backgroundSize: 'cover'
    },
    button: {
        textAlign: 'center',
        color: theme.palette.text.secondary,
        padding: theme.spacing(2),
    }

}));

const HomeBody = () => {
    const classes = useStyles();
    return(
        <div className="jumbotron jumbotron-fluid">
            <div className="container">
                <h1 className="display-4">Fluid jumbotron</h1>
                <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its
                    parent.</p>
            </div>
        </div>
    )
}
export default HomeBody
